import Link from 'next/Link';

const Navbar = () => (
  <nav id="navbar">
    <div className="container">
      <div id="nav-content">
        <div id="logo">
          <Link href="/">
            <a>
              <h1>CodeTunes</h1>
            </a>
          </Link>
        </div>
        <ul id="nav-menu">
          <Link href="/about">
            <a className="nav-link">About</a>
            </Link>
        </ul>
      </div>
      <section id="search">
        <div id="main-searchbar">
          <label htmlFor="search-input">
            <i class="fa fa-search" aria-hidden="true"></i>
          </label>
          <input type="text" name="search-input" placeholder="Search User"/>
        </div>
      </section>
    </div>
    

    <style jsx>{`
    
      #navbar {
        padding: 1.5rem 0;
        border-bottom: 1px solid white;
      }
    
      #nav-content {
        display: flex;
        justify-content: space-between;
      }

      #logo h1 {
        color: white;
        font-size: 2rem;
        text-transform: uppercase;
      }

      .nav-link {
        color: white;
      }

      #searchbar{
        width: 100%;
      }
      
      
      #main-searchbar {
        margin: auto;
        width: 50%;
        display: flex;
      }

      #main-searchbar input {
        width: 100%;
        border-radius: 5px;
        padding: 0.4rem;
      }



    `}</style>
  </nav>
)

export default Navbar;
